import custAppDict from "../languageProvider/locales/en_US.json"

const options = [
  {
    key: 'guestPortal',
    label: custAppDict["custApp.guestPortal"]
  },
  {
    key: 'guestDetails',
    label: custAppDict["custApp.guestDetails"]
  }
];
export default options;
